import React from "react";
import "./style/catalog.css";

function Сatalog() {
  return (
    <div className="catalog">
      <h2>Каталог товаров</h2>
      <div className="catalog__list">
        <div className="catalog__list_item"></div>
      </div>
    </div>
  );
}

export default Сatalog;
